import { AppBar, Toolbar, Typography, Box, TextField } from "@mui/material";

export default function TopBar({ showSearch = false, searchValue, onSearch }) {
    return (
        <AppBar position="static">
            <Toolbar>
                <Typography variant="h6" sx={{ flexGrow: 1 }}>
                    AWS Cost Dashboard
                </Typography>

                {showSearch && (
                    <Box sx={{ width: 300 }}>
                        <TextField
                            size="small"
                            placeholder="Search account..."
                            value={searchValue}
                            onChange={onSearch}
                            fullWidth
                            sx={{
                                backgroundColor: "white",
                                borderRadius: 1
                            }}
                        />
                    </Box>
                )}
            </Toolbar>
        </AppBar>
    );
}
